text:
@longtallshazza Hi there, thank you for your message.
The name of the rooms and their descriptions are set by the properties when they create a profile on our platform. Most properties provide the option to choose between a double and a twin bed.
For any other questions, please let us know.

@katfishhhhhhh Hi there, thank you for reaching out to us. We truly regret to hear about your negative experience.

If you would like us to take a look at your reservation, please send in a DM your reservation number, pin code, and the name of the guest.

Best regards.

@iscander156664 - our system will recognize that the payment isn't linked to a booking and automatically refund it back within 7-12 days.

Please don't hesitate to reach out to us again if you have any other questions.

Kind regards.

@amy0fray Hello there, thanks for reaching out to us.

Could you send us a private message with a screenshot of the gift card you are referring to, so we can look into this for you.

Looking forward to hearing back from you. https://t.co/Z89AAoEgD7

@Hwy41 Hi Jonesy, thank you for contacting us.
Although we'd like to assist you with your Taxi reservation, we're unable to do so via social media, as we do not have access to their system. We kindly recommend that you complete the web form available via https://t.co/tUSKwjNqJ9...
1/2

@CanABlKManVent In case you encounter any difficulties during check-in hours, feel free to call us immediately at this link (https://t.co/Qy2GsKgQuC).
- If you are unsure about a new property, you are encouraged to opt for a property with multiple positive reviews for added assurance.
Regards3/3

@CanABlKManVent - Kindly go through all the accommodation details ((prepayment) policies, fine print, house rules, etc.) on our website to familiarize yourself with any potential deposits, cleaning fees, etc.
- Properties tend to provide check-in instructions post booking confirmation. 
2/3

@makejdm Hi Jonathan, thank you for reaching out to us.
We regret that your points were charged, and as much as we would like to help, unfortunately we cannot support with the Rapid Rewards, as we do not have access to their system. We advise that you reach out to them directly...
1/2

@gmedemma 2/3
Please be aware that as the accommodation is the actual service provider, any refund you request should also come from them.
While we cannot alter a result that may have been communicated, we are willing to look into what happened if you would like us to.

@rochak_sethi Hi Rockak, we regret to hear this. Please let us know what has happened and how we can help you. For us to be able to take a look at your reservation, kindly DM us the following;
- PIN code
- Full guest name
Or, for immediate support, you can call us here: https://t.co/Qy2GsKgQuC https://t.co/Z89AAoEgD7

@LeighWTS For us to assist here, and look into what happened, please DM us the following details; 
- Confirmation number 
- PIN code 
- Full guest name on reservation 
For immediate support, feel free to always give us a call here: https://t.co/Qy2GsKgQuC. 
Kind regards. 2/2 https://t.co/Z89AAoEgD7
